import React from "react";
import web from "../src/images/hero-img.png";
import Common from "./Common";

const Services = (props) => {
  return (
    <>
      <Common
        name="Welcome to About Page"
        imgsrc={web}
        visit="/contact"
        btname="Get Started"
      />
    </>
  );
};

export default Services;
